import React from 'react';
import './Dashboard.css'

const Dashboard = (props) =>{
    return(
        <div className="coinlist">
            <p>{props.rank}</p>
            <p>{props.name}</p>
            <p></p><p></p>   
            {props.price}.
            {props.change}. 
            {props.vol}.
            {props.supply}.
        </div>
    )
}


export default Dashboard;
